  false,\n\t\"url\": null,\n\t\"notes\": \"This part of SIM 3319 presents data for
  part of the acoustic-backscatter map (see sheet 3, SIM 3319) of Offshore Refugio
  Beach map area, California. The raster data file is included in \"Backscatter_OffshoreRefugioBeach.zip,\"
  which is accessible from http://pubs.usgs.gov/ds/781/OffshoreRefugioBeach/data_catalog_OffshoreRefugioBeach.html.
  The acoustic-backscatter map of Offshore Refugio Beach Area was generated from backscatter
  data collected by the U.S. Geological Survey (USGS). The USGS mapped this region
  in the summer 2008 using a 234.5 kHz SEA (AP) Ltd. SWATHplus-M phase-differencing
  sidescan sonar. These data were later re-processed in 2012. Within the acoustic-backscatter
  imagery, brighter tones indicate higher backscatter intensity, and darker tones
  indicate lower backscatter intensity. The intensity represents a complex interaction
  between the acoustic pulse and the seafloor, as well as characteristics within the
  shallow subsurface, providing a general indication of seafloor texture and sediment
  type. Backscatter intensity depends on the acoustic source level; the frequency
  used to image the seafloor; the grazing angle; the composition and character of
  the seafloor, including grain size, water content, bulk density, and seafloor roughness;
  and some biological cover. Harder and rougher bottom types such as rocky outcrops
  or coarse sediment typically return stronger intensities (high backscatter, lighter
  tones), whereas softer bottom types such as fine sediment return weaker intensities
  (low backscatter, darker tones).\",\n\t\"owner_org\": \"bd2cdd5a-4d65-46c0-9937-c8381175f104\",\n\t\"extras\":
